import { useState } from "react";
import { paymentMethods } from "../styles/Constants";
import { InputBase, InputChoose, InputChooseBtn } from "../styles/Input";
import { ErrorInputText } from "../styles/TextStyles";
import { countTime } from "./functions/countTime";

export const InputPopup = ({
  data,
  register,
  valueTemp,
  setOpenPopup,
}: any) => {
  return (
    <InputChooseBtn
      onClick={() => setOpenPopup({ isActive: true, variant: data.value })}
      type="button"
      value={valueTemp}
      theme={{ width: "100%" }}
    />
  );
};

export const Input = ({ data, register, valueTemp, setOpenPopup }: any) => {
  return (
    <InputBase
      theme={{ width: "100%", height: "80%" }}
      placeholder={data?.placeholder}
      {...register}
    />
  );
};
